import React, {Component} from 'react';
import {Link} from "react-router-dom";
import './listmsg.scss';
class Productlistmsg extends Component {
    render() {
        return (
            <div className="productlistmsg">
                {/*1标题区域*/}
                <div className="head">
                    <span className="iconfont icon-jiantou"></span>
                    美食
                </div>
                {/*2、食物分类列表去*/}
                <div className="classification">
                    <div className="foodListBox">
                        <ul>
                            <li>
                                <Link to='/productlist/list1'>全部</Link>
                            </li>
                            <li>
                                <Link to='/productlist/list2'>简餐便当</Link>
                            </li>
                            <li>
                                <Link to='/productlist/list3'>小吃炸串</Link>
                            </li>
                        </ul>

                    </div>
                    <div className="foodDown iconfont icon-xiala2"></div>

                </div>
            </div>
        );
    }
}

export default Productlistmsg;
